INSERT INTO `vtiger_pdfmaker` VALUES (1,'Invoice','Invoice',_binary '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<style type=\"text/css\">@font-face {\r\n    font-family: SourceSansPro;\r\n    src: url(SourceSansPro-Regular.ttf);\r\n    font-family: Ubuntu;\r\n}\r\n\r\n.clearfix:after {\r\n  content: \"\";\r\n  display: table;\r\n clear: both;\r\n}\r\n\r\na {\r\n    color: #1B9BB8;\r\n    text-decoration: none;\r\n}\r\n\r\n{\r\n    color: #555555;\r\n    background: #FFFFFF;\r\n    font-size: 14px;\r\n    font-family: SourceSansPro;\r\n}\r\n\r\n#header {\r\n    padding: 10px 0;\r\n    margin-bottom: 0px;\r\n    border-bottom: 1px solid #AAAAAA;\r\n}\r\n\r\n#logo {\r\n    float:left;\r\n    margin: 0px;\r\n    width: 250px;\r\n}\r\n\r\n#logo img {\r\n    height: 70px;\r\n}\r\n\r\n#company {\r\n    float:left;\r\n    text-align: left;\r\n    width:350px;\r\n}\r\n\r\n#details {\r\n    margin-bottom: 15px;\r\n    padding-top: 30px;\r\n}\r\n\r\n#client {\r\n    padding-left: 6px;\r\n    border-left: 6px solid #1B9BB8;\r\n    float: left;\r\n    width: 420px;\r\n}\r\n#client2 {\r\n    padding-left: 6px;\r\n    border-left: 6px solid #BDB9B9;;\r\n    float: left;\r\n    width: 420px;\r\n\r\n}\r\n\r\n#client .to {\r\n    color: #939598;\r\n}\r\n#client2 .to {\r\n    color: black;\r\n}\r\n\r\nh2.name {\r\n    font-size: 1.4em;\r\n    font-weight: bold;\r\n    margin: 0;\r\n}\r\n\r\n#invoice {\r\n    float: right;\r\n    text-align: right;\r\n}\r\n#invoice2 {\r\n    float: right;\r\n    text-align: right;\r\n\r\n}\r\n\r\n#invoice h1, h1 {\r\n    float: right;\r\n    color: #1B9BB8;\r\n    font-size: 2em;\r\n    line-height: 2.2em;\r\n    font-weight: bold;\r\n    margin: 0px;\r\n    padding: 0px;\r\n}\r\n#invoice2 h1, h1 {\r\n    float: right;\r\n    color: #1B9BB8;\r\n    font-size: 2em;\r\n    line-height: 2.2em;\r\n    font-weight: bold;\r\n    margin: 0px;\r\n    padding: 0px;\r\n}\r\n\r\n#invoice .info {\r\n    font-size: 0.8em;\r\n}\r\n#invoice2 .info {\r\n    font-size: 0.8em;\r\n}\r\n\r\ntable {\r\n    width: 100%;\r\n    border-collapse: collapse;\r\n    border-spacing: 0;\r\n    margin-bottom: 20px;\r\n}\r\n\r\ntable th,\r\ntable td {\r\n    padding: 10px 10px;\r\n    background: #EEEEEE;\r\n    text-align: center;\r\n    border-bottom: 1px solid #FFFFFF;\r\n}\r\n\r\ntable th {\r\n    white-space: nowrap;\r\n    font-weight: normal;\r\n}\r\n\r\ntable td {\r\n    text-align: right;\r\n}\r\n\r\ntable td h3{\r\n    color: #1B9BB8;\r\n    font-size: 10px;\r\n    font-weight: normal;\r\n    margin: 0 0 0.2em 0;\r\n}\r\n\r\ntable .no {\r\n    color: #FFFFFF;\r\n    font-size: 1.2em;\r\n    background: #1B9BB8;\r\n}\r\n\r\ntable .desc {\r\n    text-align: left;\r\n}\r\n\r\ntable .unit {\r\n    background: #DDDDDD;\r\n}\r\n\r\ntable .qty {\r\n    text-align: center;\r\n}\r\n\r\ntable .total {\r\n    background: #1B9BB8;\r\n    color: #FFFFFF;\r\n}\r\n\r\ntable td.unit,\r\ntable td.qty,\r\ntable td.total {\r\n    font-size: 1 em;\r\n}\r\n\r\ntable tbody tr:last-child td {\r\n    border: none;\r\n}\r\n\r\ntable tfoot td {\r\n    padding: 10px;\r\n    font-size: 1.2em;\r\n    background: #FFFFFF;\r\n    border-bottom: none;\r\n    white-space: nowrap;\r\n    border-top: 1px solid #AAAAAA;\r\n}\r\n\r\ntable tfoot .border-none-top {\r\n    border-top: none;\r\n}\r\n\r\ntable tfoot .grand-total {\r\n    padding: 10px 7px;\r\n    color: #1B9BB8;\r\n    font-size: 1.3em;\r\n    border-top: 1px solid #1B9BB8;\r\n    font-weight:bold\r\n}\r\n\r\ntable tfoot .border-none {\r\n    border: none;\r\n}\r\n\r\n#pdf_tag{\r\n    font-size: 1.1em;\r\n    margin: 30px 0px 15px 0px;\r\n}\r\n\r\n#notices{\r\n    padding-left: 6px;\r\n    border-left: 6px solid #1B9BB8;\r\n}\r\n\r\n#notices .notice {\r\n    font-size: 1.2em;\r\n}\r\n\r\n.footer, .footer td {\r\n    background-color:#FFFFFF;\r\n    color: #939598;\r\n    border: none;\r\n    border-top: 1px solid #AAAAAA;\r\n    font-size: 0.9em;\r\n    padding: 10px 0;\r\n}\r\n\r\n.header, .header td {\r\n    background-color:#FFFFFF;\r\n    border: none;\r\n    border-bottom: 1px solid #AAAAAA;\r\n    margin:0px;\r\n    padding:0px;\r\n}\r\n</style>\r\n<div id=\"details\">\r\n<div id=\"client2\">\r\n<p style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"font-weight: bold;\">$INVOICE_ACCOUNT_ID$</span></p>\r\n$INVOICE_BILL_STREET$<br />\r\n$INVOICE_BILL_CODE$ $INVOICE_BILL_CITY$<br />\r\n$INVOICE_BILL_STATE$<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;</div>\r\n\r\n<div id=\"invoice2\">\r\n<div class=\"info\">\r\n<p style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"font-weight: bold;\">$COMPANY_NAME$</span></p>\r\n\r\n<p style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">$COMPANY_ADDRESS$<br />\r\n$COMPANY_ZIP$ $COMPANY_CITY$<br />\r\n$COMPANY_COUNTRY$</p>\r\n\r\n<p style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">%COMPANY_PHONE% $COMPANY_PHONE$<br />\r\n%COMPANY_FAX% $COMPANY_FAX$<br />\r\n<br />\r\n$COMPANY_WEBSITE$<br />\r\n<br />\r\n%M_Invoice Date%: $INVOICE_INVOICEDATE$</p>\r\n<br />\r\n&nbsp;</div>\r\n</div>\r\n</div>\r\n\r\n<div id=\"pdf_tag\"></div>\r\n\r\n<table border=\"0\" color=\"black\" style=\"font-size:10px;\" width=\"100%\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align: center;color: white;font-weight: 600;background:#BDB9B9; width:5%\"></th>\r\n			<th style=\"text-align: left;color: white;font-weight: 600;background:#BDB9B9;width:45%;border-right:2px solid white\"><span style=\"font-family:verdana,geneva,sans-serif;\"><span style=\"color:#000000;\"><strong>%G_Description%</strong></span></span></th>\r\n			<th style=\"text-align: center;color: white;font-weight: 600;background:#BDB9B9;width:15%;border-right:2px solid white\"><span style=\"font-family:verdana,geneva,sans-serif;\"><span style=\"color:#000000;\"><strong>%G_List Price%</strong></span></span></th>\r\n			<th style=\"text-align: center;color: white;font-weight: 600;background:#BDB9B9;width:15%;border-right:2px solid white\"><span style=\"font-family:verdana,geneva,sans-serif;\"><span style=\"color:#000000;\"><strong>%G_Quantity%</strong></span></span></th>\r\n			<th style=\"text-align: center;color: white;font-weight: 600;background:#BDB9B9;width:15%\"><span style=\"font-family:verdana,geneva,sans-serif;\"><span style=\"color:#000000;\"><strong>%G_Total%</strong></span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"5\"><span style=\"font-family:verdana,geneva,sans-serif;\">#PRODUCTBLOC_START#</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background:#BDB9B9;border-bottom:2px solid white\"><span style=\"font-family:verdana,geneva,sans-serif;\">$PRODUCTPOSITION$</span></td>\r\n			<td style=\"text-align:left; border-bottom:2px solid white;border-right:2px solid white;\">\r\n			<h3><span style=\"font-family:verdana,geneva,sans-serif;\">$PRODUCTTITLE$</span></h3>\r\n			<span style=\"font-family:verdana,geneva,sans-serif;\">$PRODUCTEDITDESCRIPTION$</span></td>\r\n			<td style=\"border-right:2px solid white;border-bottom:2px solid white\"><span style=\"font-family:verdana,geneva,sans-serif;\">$PRODUCTLISTPRICE$ $CURRENCYSYMBOL$</span></td>\r\n			<td style=\"border-right:2px solid white;border-bottom:2px solid white\"><span style=\"font-family:verdana,geneva,sans-serif;\">$PRODUCTQUANTITY$</span></td>\r\n			<td style=\"border-bottom:2px solid white\"><span style=\"font-family:verdana,geneva,sans-serif;\"><strong>$PRODUCTSTOTALAFTERDISCOUNT$ $CURRENCYSYMBOL$</strong></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"5\"><span style=\"font-family:verdana,geneva,sans-serif;\">#PRODUCTBLOC_END#</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"5\" style=\"background:white\"></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"background:white; border-bottom:1px solid #BDB9B9\"><span style=\"font-family:verdana,geneva,sans-serif;\">%G_Subtotal%</span></td>\r\n			<td style=\"background:#BDB9B9;\"><span style=\"font-family:verdana,geneva,sans-serif;\">$TOTALWITHOUTVAT$ $CURRENCYSYMBOL$</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"background:white; border-bottom:1px solid #BDB9B9\"><span style=\"font-family:verdana,geneva,sans-serif;\">%G_LBL_DISCOUNT%</span></td>\r\n			<td style=\"background:#BDB9B9;\"><span style=\"font-family:verdana,geneva,sans-serif;\">$TOTALDISCOUNT$ $CURRENCYSYMBOL$</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"background:white; border-bottom:1px solid #BDB9B9\"><span style=\"font-family:verdana,geneva,sans-serif;\">%G_Total%</span></td>\r\n			<td style=\"background:#BDB9B9;\"><span style=\"font-family:verdana,geneva,sans-serif;\">$TOTALAFTERDISCOUNT$ $CURRENCYSYMBOL$</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"background:white; border-bottom:2px solid #BDB9B9\"><span style=\"font-family:verdana,geneva,sans-serif;\">%G_Tax% $VATPERCENT$%</span></td>\r\n			<td style=\"background:#BDB9B9;;border-bottom:2px solid #BDB9B9\"><span style=\"font-family:verdana,geneva,sans-serif;\">$VAT$ $CURRENCYSYMBOL$</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"background:white;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp; %G_LBL_GRAND_TOTAL%</strong></td>\r\n			<td style=\"background:white\"><span style=\"font-family:verdana,geneva,sans-serif;\"><span style=\"font-size:12px;\"><strong>$TOTAL$ $CURRENCYSYMBOL$</strong></span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div id=\"details\">\r\n<div id=\"client2\"><span style=\"font-family:verdana,geneva,sans-serif;\">$INVOICE_TERMS_CONDITIONS$</span></div>\r\n\r\n<div id=\"invoice\"><br />\r\n<br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:verdana,geneva,sans-serif;\">____________________________</span><br />\r\n$R_USERS_FIRST_NAME$​ $R_USERS_LAST_NAME$​</div>\r\n</div>\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;</body>\r\n</html>\r\n','Template for Invoice',0),(2,'SalesOrder','SalesOrder',_binary '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<style type=\"text/css\">@font-face {\r\n    font-family: SourceSansPro;\r\n    src: url(SourceSansPro-Regular.ttf);\r\n    font-family: Ubuntu;\r\n}\r\n\r\n.clearfix:after {\r\n  content: \"\";\r\n  display: table;\r\n clear: both;\r\n}\r\n\r\na {\r\n    color: #1B9BB8;\r\n    text-decoration: none;\r\n}\r\n\r\n{\r\n    color: #555555;\r\n    background: #FFFFFF;\r\n    font-size: 14px;\r\n    font-family: SourceSansPro;\r\n}\r\n\r\n#header {\r\n    padding: 10px 0;\r\n    margin-bottom: 0px;\r\n    border-bottom: 1px solid #AAAAAA;\r\n