-spacing: 0;\r\n    margin-bottom: 20px;\r\n}\r\n\r\ntable th,\r\ntable td {\r\n    padding: 10px 10px;\r\n    background: #EEEEEE;\r\n    text-align: center;\r\n    border-bottom: 1px solid #FFFFFF;\r\n}\r\n\r\ntable th {\r\n    white-space: nowrap;\r\n    font-weight: normal;\r\n}\r\n\r\ntable td {\r\n    text-align: right;\r\n}\r\n\r\ntable td h3{\r\n    color: #1B9BB8;\r\n    font-size: 10px;\r\n    font-weight: normal;\r\n    margin: 0 0 0.2em 0;\r\n}\r\n\r\ntable .no {\r\n    color: #FFFFFF;\r\n    font-size: 1.2em;\r\n    background: #1B9BB8;\r\n}\r\n\r\ntable .desc {\r\n    text-align: left;\r\n}\r\n\r\ntable .unit {\r\n    background: #DDDDDD;\r\n}\r\n\r\ntable .qty {\r\n    text-align: center;\r\n}\r\n\r\ntable .total {\r\n    background: #1B9BB8;\r\n    color: #FFFFFF;\r\n}\r\n\r\ntable td.unit,\r\ntable td.qty,\r\ntable td.total {\r\n    font-size: 1 em;\r\n}\r\n\r\ntable tbody tr:last-child td {\r\n    border: none;\r\n}\r\n\r\ntable tfoot td {\r\n    padding: 10px;\r\n    font-size: 1.2em;\r\n    background: #FFFFFF;\r\n    border-bottom: none;\r\n    white-space: nowrap;\r\n    border-top: 1px solid #AAAAAA;\r\n}\r\n\r\ntable tfoot .border-none-top {\r\n    border-top: none;\r\n}\r\n\r\ntable tfoot .grand-total {\r\n    padding: 10px 7px;\r\n    color: #1B9BB8;\r\n    font-size: 1.3em;\r\n    border-top: 1px solid #1B9BB8;\r\n    font-weight:bold\r\n}\r\n\r\ntable tfoot .border-none {\r\n    border: none;\r\n}\r\n\r\n#pdf_tag{\r\n    font-size: 1.1em;\r\n    margin: 30px 0px 15px 0px;\r\n}\r\n\r\n#notices{\r\n    padding-left: 6px;\r\n    border-left: 6px solid #1B9BB8;\r\n}\r\n\r\n#notices .notice {\r\n    font-size: 1.2em;\r\n}\r\n\r\n.footer, .footer td {\r\n    background-color:#FFFFFF;\r\n    color: #939598;\r\n    border: none;\r\n    border-top: 1px solid #AAAAAA;\r\n    font-size: 0.9em;\r\n    padding: 10px 0;\r\n}\r\n\r\n.header, .header td {\r\n    background-color:#FFFFFF;\r\n    border: none;\r\n    border-bottom: 1px solid #AAAAAA;\r\n  